import './Login.css';

const Login=()=>{
    return (
        <div className='wrapper'>
            <form action="">
                <h1>Login</h1>
                <div className="input-box">
                    <input type="text" placeholder="Username"/>
                </div>
            </form>
        </div>
    );
};
export default Login;
